  <>
    <Card imgsrc="https://picsum.photos/id/237/200/300" title="a netflix original series" sname="DARK"/>
    <Card imgsrc="https://picsum.photos/id/247/200/300" tilte="a netflix original series" sname="BATMAN"/>
    <Card imgsrc="https://picsum.photos/id/250/200/300" tilte="a netflix original series" sname="SUPERMAN"/>




  </>,
  document.getElementById("root")
